function calculateDominicanPayroll(l){if("number"!=typeof l)return null;const n=.0304*l,t=.0287*l,e=n+t,a=l-e;let o=0;const c=34685,i=52027.4167,r=72260.25;if(a>=c&&a<=i){o=.15*(a-c)}else if(a>=i&&a<=r){o=2601.33+.2*(a-i)}else if(a>=r){o=6648+.25*(a-r)}const f=e+o;return{monthlySalary:l,netMonthlySalary:l-f,sfs:n,afp:t,isr:o,deductions:f}}export default calculateDominicanPayroll;